export const PRACTICE_QUESTIONS = {
  Backtracking: [
    {
      title: "Letter Combinations of a Phone Number",
      description: `
Given a string containing digits from 2-9 inclusive, return all possible letter combinations.

Example:
Input: digits = "23"
Output: ["ad","ae","af","bd","be","bf","cd","ce","cf"]
      `
    },
    {
      title: "Generate Parentheses",
      description: `
Given n pairs of parentheses, generate all combinations of well-formed parentheses.

Example:
Input: n = 3
Output: ["((()))","(()())","(())()","()(())","()()()"]
      `
    },
    {
      title: "Combination Sum",
      description: `
Return all unique combinations that sum to target.
      `
    },
    {
      title: "Permutations",
      description: `
Return all possible permutations of distinct integers.
      `
    },
    {
      title: "N-Queens",
      description: `
Place n queens on an n x n chessboard so no two queens attack each other.
      `,
      image: "/nqueens.png"
    },
    {
      title: "Subsets",
      description: `
Return all possible subsets (power set).
      `
    },
    {
      title: "Palindrome Partitioning",
      description: `
Partition string s such that every substring is a palindrome.
      `
    }
  ]
};
